Ext.data.JsonP['Dashboard_4.12.2_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Dashboard 4.12.2  - 24 May 2017</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-49162115\" class=\"content\">\n                        <h1>Dashboard 4.12.2  - 24 May 2017</h1>\n    <p>Dashboard 4.12.2 is a patch release, which includes improvements and several bug fixes.    </p>\n    <div class=\"section section-2 \" id=\"src-49162115_Dashboard4.12.2ReleaseNote-Improvements\">\n        <h2 class=\"heading \"><span>Improvements</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Improved security of activation and &quot;forgot password&quot; processes    </p>\n</li><li class=\" \">    <p>Improved security of device authorization process    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-49162115_Dashboard4.12.2ReleaseNote-Fixedissues\">\n        <h2 class=\"heading \"><span>Fixed issues</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Fixed issue where users may not be able to import an existing app into the org to which it&apos;s currently registered    </p>\n</li><li class=\" \">    <p>Fixed issue where users may not be able to build apps they have rights to that are registered to an organization they are not currently logged into    </p>\n</li><li class=\" \">    <p>Fixed issue where event funnel order may not properly save    </p>\n</li><li class=\" \">    <p>Fixed display issue when filtering ArrowDB custom objects table view    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=49162115\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Dashboard 4.12.2 Release Note"});